import styled from "styled-components";

function SideMenu({ setMenuOpen }) {
  const closeMenu = () => {
    setMenuOpen(false);
  };
  return (
    <Mbtn onClick={closeMenu}>
      <Wrap>
        <LineWrap>
          <i></i>
          <i></i>
          <i></i>
        </LineWrap>
        <ul>
          <li>
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./index.php" class="mainBtn_m">
                ABOUT
              </a>
              <span></span>
            </div>
          </li>
          <li class="addNav_m nav_m1">
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./sub/design_uiux.php" class="mainBtn_m">
                SKILLS
              </a>
              <span></span>
            </div>
          </li>
          <li>
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./sub/develop.php" class="mainBtn_m">
                DEVELOP
              </a>
              <span></span>
            </div>
          </li>
          <li>
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./sub/about.php" class="mainBtn_m">
                PROJECT
              </a>
              <span></span>
            </div>
          </li>
        </ul>
      </Wrap>
    </Mbtn>
  );
}

const Mbtn = styled.div`
  z-index: 5;
  display: block;
  position: fixed;
  top: 0;
  left: 50%;
  background: #0c1017;
  width: 100%;
  height: 100%;
  transition: all 0.3s;
  overflow: hidden;
`;

const Wrap = styled.div`
  width: 100%;
  max-width: 1400px;
  margin: 0 auto;

  li {
    width: 100%;
    display: flex;
    justify-content: space-around;
  }
`;

const LineWrap = styled.div`
  width: 60px;
  height: 45px;
  position: relative;
  margin: 50px auto;
  -webkit-transform: rotate(0deg);
  -moz-transform: rotate(0deg);
  -o-transform: rotate(0deg);
  transform: rotate(0deg);
  -webkit-transition: 0.5s ease-in-out;
  -moz-transition: 0.5s ease-in-out;
  -o-transition: 0.5s ease-in-out;
  transition: 0.5s ease-in-out;
  cursor: pointer;

  /* display: inline-block;
    span {
      &:first-child {
        overflow: hidden;
        position: relative;
        display: inline-block;
        width: 21px;
        height: 14px;
      }
      &:last-child {
        display: inline-block;
      } */
  i {
    display: block;
    position: absolute;
    height: 9px;
    width: 100%;
    background: #d3531a;
    border-radius: 9px;
    opacity: 1;
    left: 0;
    -webkit-transform: rotate(0deg);
    -moz-transform: rotate(0deg);
    -o-transform: rotate(0deg);
    transform: rotate(0deg);
    -webkit-transition: 0.25s ease-in-out;
    -moz-transition: 0.25s ease-in-out;
    -o-transition: 0.25s ease-in-out;
    transition: 0.25s ease-in-out;
    /* &:first-child {
          top: ${({ menuOpen }) => (menuOpen ? "50%" : "0")};
          margin-top: ${({ menuOpen }) => (menuOpen ? "-1px" : "0")};
          transform: ${({ menuOpen }) => (menuOpen ? "rotate(135deg)" : "rotate(0)")};
        } */
    &:first-child {
      top: ${({ closeMenu }) => (closeMenu ? "0px;" : "18px")};
      transform: ${({ closeMenu }) => (closeMenu ? "rotate(135deg)" : "rotate(0)")};
    }

    /* &:nth-child(2) {
          width: ${({ closeMenu }) => (closeMenu ? "0" : "70%")};
          top: ${({ closeMenu }) => (closeMenu ? "0" : "50%")};
          margin-top: ${({ closeMenu }) => (closeMenu ? "0" : "-1px")};
        } */
    &:nth-child(2) {
      top: ${({ closeMenu }) => (closeMenu ? "0" : "18px")};
      opacity: ${({ closeMenu }) => (closeMenu ? "0" : "1")};
      left: ${({ closeMenu }) => (closeMenu ? "-60px" : "0")};
    }
    &:last-child {
      top: ${({ closeMenu }) => (closeMenu ? "-18px;" : "36px")};
      transform: ${({ closeMenu }) => (closeMenu ? "rotate(-135deg)" : "rotate(0)")};
    }
    /* &:last-child {
          bottom: ${({ closeMenu }) => (closeMenu ? "50%" : "0")};
          margin-bottom: ${({ closeMenu }) => (closeMenu ? "-1px" : "0")};
          transform: ${({ closeMenu }) => (closeMenu ? "rotate(-135deg)" : "rotate(0)")};
        } */
  }
`;

